import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router";

export default function HomePageDisplay() {
    const navigate = useNavigate();

    async function click(e) {
        e.preventDefault();

        navigate("/mainPage");
    }

    return (
        // This is the HTML for the HOMEPAGE
        <div class="Homepage">
            <h2>Test</h2>
            <input type="text" id="tickersym" name="tickersym" placeholder="Enter ticker symbol"></input>
            <input
                type="submit"
                value="Submit"
                className="btn btn-primary"
                onClick={click}
            />

            {/* This is the HTML for the MAIN PAGE */}
            <div class="Mainpage">
                <h1>Test</h1>
            </div>


            {/* This is the HTML for the Buy/Sell PAGE */}
            <div class="buysellpage"></div>

        </div>
    )
}
